import React from "react";
import { Link, Route, Switch } from 'react-router-dom';
import MenuWine from "./MenuWine";
import MenuFood from "./MenuFood";

const ModeSelect = () => {
  return (
    <div className="mode-select">
          <p>ModeSelect</p>
          <Link to="/">
          <p>To Welcome</p>
          </Link>
          <Link to="/menuwine">
              <p>I have a recipe, help me find a wine!</p>
          </Link>
          <Link to="/menufood">
              <p>I have a wine, help me find a recipe!</p>
          </Link>
          <Switch>
              <Route path="/menuwine" component={MenuWine} />
              <Route path="/menufood" component={MenuFood} />
          </Switch>
    </div>
  );
};

export default ModeSelect;
